(2, '2018-08-22 12:41:05', 212, 2, 'At the site visit, I did notice a procedure to acces the plant through the gate by signing in and follow instructions by the gate gard. At the job area, there enclosemtn of the room will need to be taken care with enough ventilation, as workers need to wear respiration mask. When braking the concrete the operator and supervisor needs to have a tool box meeting in order to determine a plan to take care of the wall and sections that does not need to be demolish in order to prevent unnecessary damages; when the concrete will be transport to the dump truck it will be necessary to have a spotter due to the volume of workers on site.  '),
