(47, '2018-11-29 06:28:05', 240, 2, 'On Nov 27,2018. at the site visit. I notice there is a limitation of room, PSL fence and a new building. when loading and off loading equipment from or on the trailer, we need to be careful due the amount of snow. when setting up the temp fence, we need to be careful when using ladders. the use of data/phone usage needs to be limited.'),
