(58, '2019-02-11 10:18:22', 21, 8, ''),
(59, '2019-02-19 17:31:22', 250, 2, 'once we arrived at the site, we notice lots of snow on the road, significant amount of traffic on the road, windy conditions.'),
(60, '2019-02-28 08:34:55', 247, 2, ''),
(61, '2019-02-28 08:42:16', 247, 2, 'On todays visit, we notice a good amount of snow on the ground preventing us to see what is exactly is under the snow; therefore, we located an entrance to prevent driving around the site. Since the last three weeks we had being under temperatures 30 degrees below zero, our employees must wear winter clothing. If the underground utilities found are electrical we must consider using a ground mat to prevent any electrical shock. We are working 40 meters away from airside PSL fence, therefore we need to be aware of any airside emergency that may affect our job.'),
(62, '2019-02-28 10:02:26', 251, 4, ''),
(63, '2019-02-28 13:55:22', 251, 2, '•	It is important to have a place to park our vehicles. \r\n\r\n•	For staff entry it is necessary to request a card to access site.\r\n\r\n•	At the exit of the elevator there is a passage it’s delineated by a continuous yellow line, one side is for the transit of forklifts and at the other side is for pedestrians, we must  be aware and use just the pedestrian side.\r\n\r\n•	We have just one entrance to the job area, in this entrance we must to install signage (deep excavation, restricted area, people working and mandatory PPE used) and close the job area to avoid pedestrian traffic inside. \r\n\r\n•	Before start working at the excavation, we must have locates just to know if our job area is clear to work.\r\n\r\n•	To mitigate dust, use a dust-free power tools and use a vacuum to keep slurry far to the storm or sanitary lines.\r\n\r\n•	We are going to do an excavation about 1.8m deep we must to use shoring and ladders for easy exit and access to the trench\r\n\r\n•	We are going to work inside a building, we can’t use diesel or gas just electric equipment.\r\n\r\n•	We are going to work between a refrigerators and offices. We must to be very careful don’t hit any of the two sides when the excavation is being done.\r\n\r\n•	To remove the broken concrete, we must to use a container or use bags to avoid spill and keep the area clean.\r\n\r\n•	Before start removing the existing pipe make sure you have a pump and do the disposal in an appropriated place.\r\n\r\n\r\n'),
