(80, '2019-05-09 22:15:02', 257, 2, 'Based on the site observation, the site would need to be enclosed with approved deliminator barrels as per YYC specification. Also, since the work area is Airsite, we need to follow the red pass person in charge instructiions. the main gates must be close at all time to avoid any bridge from ground site to air site. once the excavation begins, we need to be careful about the straight cuts on the edges of the repair zone, like wise when back filling.  it is important to maintain a two way communication with the guys from EFC.'),
(81, '2019-05-10 07:50:36', 251, 4, ''),
(82, '2019-05-15 13:40:38', 268, 2, 'as per our observation on site, we need to have in consideration: traffic, power lines, power transformers,  pedestrians, trees. '),
(83, '2019-05-27 07:35:47', 181, 4, ''),
(84, '2019-05-27 07:36:09', 181, 4, ''),
(85, '2019-05-29 14:07:24', 270, 2, 'As per our site visit, we notice: medium traffic volume as well as low pedestrian traffic, since it is a incidental area it is very important to know the allowable working hours. Remarks, working area needs to be delineated, use stakes and warning tape to mark open excavations. be careful with buildings, trees, pedestrians, traffic, cars.   '),
(86, '2019-06-01 07:54:21', 272, 2, 'Carefully load material onto the truck using the skit steer, be careful when entering the road, before rising the box make sure the ground is level.'),
(87, '2019-06-04 10:51:51', 247, 8, ''),
(88, '2019-06-05 21:18:14', 274, 2, 'since it is on a residential area we need to be really careful with all the existing landscaping, houses, power lines, traffic, pedestrians, pets, and houses. proceed carefully.'),
