(93, '2019-06-11 08:37:16', 275, 2, ' Asper our site visit today we identify today’s work is air side. We need to be really careful and follow the escort instructions also be aware of any pull back due to any aircraft emergency.  While cleaning the fuel and surface the worker needs to be aware of their surrounding, buildings, pedestrians, traffic, air traffic '),
