(342, '2021-01-22 08:41:24', 400, 10, 'As per today\'s site inspection, the safety advisor found the following hazards based on our SOW (Scope of Work). VCI\'s scope will be divided into two phases (Jan 23, 2021, Remove panels to identify assembly & Jan 28, 2121, Remove approximate 12 Panels as per YYC link \"u\" turn try out). Working hours TBD by YYC. In order to remove all the panels in phase 1,2, VCI will use hand and power tools such as hand drills and hamers. Some of the common hazards as per the site visitor is: working close to building\'s walls, poles, windows, and corridors, dust, pannel weight, enclose working areas. While removing the panels, weight needs to be contemplated in order to prevent any back injury while removing/relocating/installing, Utilities if any will be marked. Some health hazards are Covid working protocols'),
