(345, '2021-02-22 09:39:43', 403, 2, 'Based on site visit of Feb 22- Possible hazards include plane and vehicle traffic, noise, icy surfaces, changing weather conditions, use of manual equipment, use of power tools, communication inefficiencies, working at close distance..\r\nthe controls implemented to mitigate these hazards are: following instructions from escorts and supervisors at all times, being aware of surroundings, ensuring clear discussion of work plan without deviation, availability of hearing protection, awateness of body positioning, ensuring proficiency in use of tools or close supervision while in-training, wearing face masks. hand sanitizer'),
