(354, '2021-03-30 10:46:52', 404, 62, 'Based on supervisors observations, there is potential hazards with a river, wild life, heavy lifting, communication and accessibility deficiencies, powered tools, potential work at heights, slope, mobilization of quads, people and activities, slips snow water, pinch points, heavy equipment operations, excavation, backfilling, demolition, field storage management, skid steer'),
(355, '2021-03-30 11:57:32', 404, 62, 'Based on supervisors observations, there are potential hazards with a river, wildlife, heavy lifting, communication and accessibility deficiencies, use of powered tools, potential work at heights, sloping terrain, high traffic of quads, people and activities near-by. There is potential for slips and trips given the presence of snow and water on the ground. Other hazards may include pinch points, heavy equipment operations.'),
(356, '2021-03-31 17:20:39', 411, 2, 'As per our records and performance on similar Job\'s task. Our street sweeper operator will evaluate daily hazards through an FLHA. Any new hazard or up-date on this JHA will show on our JHA log.\r\nOn this particular Job, our operator will consider the following hazards on-site.\r\n* Incoming and outcoming traffic from the job site area\r\n* Local traffic and speed zones.\r\n* Pedestrians in the area.\r\n* Control the amount of water and dust produce by the unit.\r\n* Weather conditions and or changes on the forecast.\r\n* Unsafe driving*\r\n* Not using a hand-held device while driving. \r\n'),
(357, '2021-03-31 17:23:22', 412, 2, '	As per our records and performance on similar Job\'s task. Our street sweeper operator will evaluate daily hazards through an FLHA. Any new hazard or up-date on this JHA will show on our JHA log. On this particular Job, our operator will consider the following hazards on-site. * Incoming and outcoming traffic from the job site area * Local traffic and speed zones. * Pedestrians in the area. * Control the amount of water and dust produce by the unit. * Weather conditions and or changes on the forecast. * Unsafe driving * Not using a hand-held device while driving.'),
