(364, '2021-04-07 19:39:45', 416, 2, 'As per our site visit meeting and based on our work scope, the following considerations and the project\'s caveats needs to be addressed. \r\n<br>* Critical work area – Apron 1 \r\n<br>* Crossing an active – Taxiway – Juliet. \r\n<br>* Driving on a new VSR. \r\n<br>* Following escorts instructions. \r\n\r\n<br><br>We need to identify: \r\n<br>* Identify areas of safety. \r\n<br>* Determine safe routes to a medical centre. \r\n<br>* Appointed personnel to assist in an emergency. \r\n<br>* Understanding escorts instructions. \r\n<br>* Identify where trained staff is needed. \r\n<br>* Identify areas of evacuation. \r\n<br>* Reduce aircraft impact by controlling air pollution. \r\n<br>* High noise decibels. \r\n<br>* Safely operate heavy equipment. \r\n<br>* Safely manipulate and load concrete slabs. \r\n<br>* Debris on Apron 2, Active VSR and Juliet (taxiway). \r\n\r\n<br><br>Some of the Following hazards identified on site: \r\n<br>High noise decibels – high concrete silica particles – wet surfaces – uncontrolled loads – inadequate cargo securement – workspace limitation. \r\n<br>This JHA will be followed and updated weekly to consider any new job tasks/hazards that may arise. '),
(365, '2021-04-07 20:44:05', 415, 2, 'As per our site visit.\r\n•	Scope of work, survey centerlines on taxiway Golf, using station and a GNSS\r\n\r\nThe following hazards were identify for the scope of work and tasks described.\r\n\r\n•	Active Apron 1.\r\n•	Active Golf Taxiway.\r\n•	Working on pull back protocol.\r\n•	Working closer to an aircraft.\r\n•	Hot weather.\r\n•	Aircraft turbine noise.\r\n•	Wind (high speed)\r\n'),
