(395, '2021-06-22 13:47:55', 435, 32, 'Tuesday June 22nd, 2021<br>\r\nAs per Today site visit, the following hazards were identify based on our scope of work.\r\n<strong> * Scope of work. </strong> <br>\r\nRemove existing concrete swell. <br>\r\nInstall 3 new Cb’s <br>\r\nInstall underground pipe. <br> \r\nRestore all disturb areas (Landscaping, sidewalks, and road.) <br>\r\n<br>\r\n<strong> * Items to review. </strong> <br>\r\nRush hours – local traffic <br>\r\nPedestrians. <br>\r\nVehicles parked on the road. <br>\r\nBlocking driveways. <br>\r\nLane closure. <br>\r\n<br>\r\n<strong> * Potential Hazards. </strong> <br>\r\nCOVID 19. <br>\r\nUnderground utility. <br>\r\nOpen excavation. <br>\r\nWeather (uv radiation, rain). <br>\r\nMoving equipment. <br>\r\nOn-foot personnel. <br>\r\nLoading broken concrete and asphalt. <br>\r\nFueling on-site. <br>\r\nLoading and offloading Equipment, <br>\r\nConstruction fence not being secure. <br>\r\n<br>\r\n<strong> * Notes. </strong> <br>\r\n* Any new observation or change will be added to our weekly JHA.<br>  \r\n* Any new visitor, worker, subcontractors will need to be site-oriented.<br>\r\n* Workers, Subcontractors, Visitors, escorts will need to contact our site supervisor before accessing our site.<br>\r\n'),
(396, '2021-06-22 20:52:03', 422, 2, 'Tuesday June 22nd, 2021 <br>\r\nAs per Today site visit, the following hazards were identify based on our scope of work. <br>\r\n<strong> * Scope of work. </strong> <br>\r\nSurvey – Existing ground and provide information <br>\r\nHydrovac – Expose underground utilities <br>\r\n<br>\r\n<strong> * Items to review. </strong>\r\nRush hours – local traffic. <br> \r\nPedestrians. <br>\r\nVehicles parked on the road. <br>\r\nLane closure. <br>\r\n<br>\r\n<strong> * Potential Hazards. </strong> <br>\r\nCOVID 19. <br>\r\nUnderground utility. <br>\r\nOpen excavation. <br>\r\nWeather (uv radiation, rain). <br>\r\nMoving equipment. <br>\r\nOn-foot personnel. <br>\r\n<br>\r\n<strong> * Notes. </strong> <br>\r\n* Any new observation or change will be added to our weekly JHA. <br>\r\n* Workers, Subcontractors, Visitors, escorts will need to contact our site supervisor before accessing our site. <br>\r\n'),
