(404, '2021-08-03 15:36:34', 447, 32, ''),
(405, '2021-08-04 12:12:36', 447, 32, '<strong>WEST RUNWAY REHABILITATION – HYDROVAC AND CAMARA INSPECTIONS</strong> <br>\r\n<br>\r\nAs per our site visit assessment, the following hazards/items were identified: <br>\r\n<strong>Entry gates:</strong> <br>\r\n<br>\r\n-Gate 420 in the North applies to sections 1 and 2<br>\r\n- Gate 205 in the South applies to sections 3 and 4<br>\r\n- Gate 402 in the West applies to section 4 and 5<br>\r\n<br>\r\n<strong> Before entering Airside: </strong> <br>\r\n<br>\r\n-No pets are allowed on the airside. <br>\r\n-No Children are allowed on the airside. <br>\r\n-No knives are allowed on air sites. <br>\r\n-No guns are allowed on air sites. <br>\r\n-Must have a valid ID. <br>\r\n-Visitors must return their visitor pass (fine to anyone who removes the pass from the air site). <br>\r\n\r\n<strong> Assigned working areas: </strong>  <br>\r\n-As per the barrel plans provided by the YYC, each section will have different closure setups; therefore, we need to identify the current section of work in the plans and remain within the limits of the barrels. <br>\r\n\r\n<strong> Scope of work: </strong>  <br>\r\n- Driving <br>\r\nA spotter must be in place when backing up Hydrovac and trucks. <br>\r\nDriver must make eye contact with personnel on foot. <br>\r\nBeacons or 4 ways hazard light must be on when working airside. <br>\r\n \r\n- Exposing underground utilities. <br>\r\nSince most of the trenches have a 3-meter depth, caving material must be prevented. <br>\r\nHydrovac operators must prevent damages to PVC pipes or any underground utility. <br>\r\n\r\n - Survey utilities and video inspections. <br>\r\nOperators must evaluate any hazards related to high voltage, caving material and traffic in the work areas. <br>\r\n \r\n- Backfill open excavation <br>\r\nBackfill only with material approved. <br>\r\n300 mm of bedding sand on top of PVC pipes and around 1.5 meters with drain rock. <br>\r\n\r\n- Loading backfill material. <br>\r\nDrivers must make eye contact with the loader operator. <br>\r\nLoader operator must make eye contact with drivers and on-foot personnel. <br>\r\nMake sure the ground is level before loading trucks. <br>\r\nDrivers must tarp each load to prevent debris from flying out to taxiways and the runway. <br>\r\n\r\n\r\n- Dumping Hydrovac debris. <br>\r\nDrivers must dump at designated areas. <br>\r\nUse spotter when necessary. <br>\r\nTailgates must be clean before driving on public roads. <br>\r\n\r\n\r\n<strong> E R P </strong> <br>\r\n- Muster point will be determined by the CAA escorts <br>\r\n- head counter- <strong> Assigned on-site </strong>  <br>\r\n- First Aid station <strong> Emergency on-site station (EOS) </strong> <br>\r\n- Extinguishers – <strong> Found in ESO and each truck/equipment. </strong> <br>\r\n- eye wash – <strong> Found in EOS. </strong> <br>\r\n- Directions to the nearest hospital -<strong> Rocky View</strong>  <br>\r\n- Covid 19 – <strong> follow protocols and YYC mandatory regulations. </strong>  <br>\r\n\r\n<strong> Special items to monitor </strong>  <br>\r\n-weather high Temperatures, high wind and heavy rain. <br>\r\n-Confined space entry permit must be fill before accessing confine areas. <br>\r\n\r\n<strong> Appendix/notes </strong>  <br>\r\nOur JSO/ hazards will be updated weekly as per any change on our scope of work <br>\r\n'),
(406, '2021-08-10 10:38:41', 450, 3, ''),
(407, '2021-08-13 13:32:08', 449, 36, 'Tuesday June 22nd, 2021\r\nAs per Today site visit, the following hazards were identify based on our scope of work. * Scope of\r\nwork. \r\nRemove existing concrete swell.\r\nInstall 3 new Cb’s\r\nInstall underground pipe.\r\n Restore all disturb areas (Landscaping, sidewalks, and road.)\r\n * Items to review. \r\nRush hours – local traffic\r\nPedestrians.\r\nVehicles parked on the road.\r\nBlocking driveways.\r\nLane closure.\r\n * Potential Hazards. \r\nCOVID 19.\r\nUnderground utility.\r\nOpen excavation.\r\nWeather (uv radiation, rain).\r\nMoving equipment.\r\nOn-foot personnel.\r\nLoading broken concrete and asphalt.\r\nFueling on-site.\r\nLoading and offloading Equipment,\r\nConstruction fence not being secure.\r\n * Notes. \r\n* Any new observation or change will be added to our weekly JHA.\r\n * Any new visitor, worker, subcontractors will need to be site-oriented.\r\n* Workers, Subcontractors, Visitors, escorts will need to contact our site supervisor before accessing our\r\nsite.'),
(408, '2021-08-13 13:45:26', 449, 26, ''),
(409, '2021-08-16 12:07:20', 449, 32, ' <strong>Scope of work:</strong> <br>The work consists of the localization of\r\nearthwork regrading, catch basin installation, regrading and repairing asphalt pathways, and the removal and replacement of stairway.<br>\r\n<strong>The following hazards were identified based on the scope of\r\nwork :</strong> <br>\r\n<strong>Mobilization and demobilization.</strong><br>\r\n- Make sure all loads are properly secure.<br>\r\n- Inspec, each load before accessing public roads.<br>\r\n<strong>Loading and offloading equipment.</strong><br>\r\n- Consider each piece of equipment operating weight.<br>\r\n- Make sure equipment is clean before accessing public roads.<br>\r\n<strong>Setting up construction fence.</strong><br>\r\n- Follow established procedures.<br>\r\n- Make sure fence is well secure.<br>\r\n<strong>Setting-up signage.</strong><br>\r\n- Consider the location of each sign to prevent pedestrians and traffic confusion.<br>\r\n- Consider the location of each sign to prevent pedestrians from getting hurt.<br>\r\n<strong>Preparing site.</strong><br>\r\n- Based on the workplace space distribution, place all items on a safe location.<br>\r\n- Items such as the site office trailer, portable toilets, and the re-fueling station should be positioned in a place where they do not pose a hazard for workers or citizens.<br>\r\n<strong>Stripping.</strong><br>\r\n- Make sure clean backfill will not be contaminated with loam or grass.<br>\r\n- Properly dispose of loam and grass<br>\r\n<strong>Excavating / Placing shoring.</strong><br>\r\n- Operators make sure to follow trench excavating procedures - No one should access the excavation zone without a proper slope or use of shoring.<br>\r\n- On-foot personnel must make eye contact with the operator at all times.<br>\r\n- When moving shoring structures, a secure line must be in place to control the load.<br>\r\n<strong>Backfilling.</strong><br>\r\n- Make sure no organics are present within clean backfill material.<br>\r\n- Each Lift must be 30 cm or one foot thick.<br>\r\n- No worker should access trench without a proper trench slope or use of shoring.<br>\r\n<strong>Restoring impacted landscaping.</strong><br>\r\n- Make sure not to excess stripping boundries.<br>\r\n- Avoid creating unnecessary impacts on other areas.<br>\r\n<strong>Berm construction.</strong><br>\r\n- Strip only marked areas.<br>\r\n- Dump trucks must have a spotter when backing up.<br>\r\n- Avoid working on rainy days.<br>\r\n\r\n<strong>Items to review daily.</strong><br>\r\nTrees prevention plan.<br>\r\nPresence of children in the area.<br>\r\nWeather - Hot temperature and wind.<br>\r\nProximity to close homes.<br>\r\n\r\n\r\n - Notes:<br> * Any new observation or change will be added to our weekly JHA.<br> * Any new visitor, worker, and subcontractors will need to be site-oriented. <br>* Workers, Subcontractors, and Visitors will need to contact our site supervisor before accessing our site.'),
(410, '2021-08-16 12:10:51', 449, 32, ''),
