(412, '2021-08-17 17:46:56', 454, 3, ''),
(413, '2021-08-19 09:17:37', 423, 36, '<strong>Pre-Job Hazard Assessment based on scope of work </strong>\r\n<br>\r\n<strong>Scope of work:</strong>\r\n<br>\r\nThe work involves the catch basin additions and upgrades on the MacLeod Trail S & 38 Ave SW location \r\n<br>\r\nThe following hazards were identified based on the scope of work:\r\n<br>\r\n<strong>Mobilization and demobilization.</strong>\r\n- Make sure all loads are properly secure.\r\n- Inspect, each load before accessing public roads.\r\n<br>\r\n<strong>Loading and offloading equipment.</strong>\r\n- Consider each piece of equipment operating weight.\r\n- Make sure equipment is clean before accessing public roads.\r\n<br>\r\n<strong>Setting up construction fence.</strong>\r\n- Follow established procedures.\r\n- Make sure fence is well secure.\r\n<br>\r\n<strong>Traffic Set up by the City of Calgary.</strong>\r\n- Consider the location of each sign to prevent pedestrians and traffic confusion.\r\n- Consider the location of each sign to prevent pedestrians from getting hurt.\r\n-	Make sure the set up is properly set up and secure \r\n<br>\r\n<strong>Preparing site.</strong>\r\n- Based on the workplace space distribution, place all items on a safe location.\r\n- Items such as the site office trailer, portable toilets, and the re-fueling station should be positioned in a place where they do not pose a hazard for workers or citizens.\r\n<br>\r\n<strong>Bypass Plan: </strong>\r\n-	Review bypass permit and plan\r\n-	Review emergency response procedure in case of spill contamination \r\n<br>\r\n<strong>Excavating / Placing shoring.</strong>\r\n- Operators make sure to follow trench excavating procedures - No one should access the excavation zone without a proper slope or use of shoring.\r\n- On-foot personnel must make eye contact with the operator at all times.\r\n- When moving shoring structures, a secure line must be in place to control the load.\r\n<br>\r\n<strong>Backfilling.</strong>\r\n- Make sure no organics are present within clean backfill material.\r\n- Each Lift must be 30 cm or one foot thick.\r\n- No worker should access trench without a proper trench slope or use of shoring.\r\n<br>\r\n<strong>Asphalt and Concrete placing </strong>\r\n-	Evaluate fumes inhalation \r\n-	Bodily exposure risks.\r\n<br>\r\n<strong>Items to review daily.</strong>\r\nWeather - Hot temperatures, wind, and precipitation \r\nHigh vehicle traffic in the area \r\nNoise Control \r\nProximity to Subaru dealership\r\n<br>\r\n-<strong>Notes:</strong>\r\n* Any new observation or change will be added to our weekly JHA.\r\n* Any new visitor, worker, and subcontractors will need to be site oriented.\r\n* Workers, Subcontractors, and Visitors will need to contact our site supervisor before accessing our site.\r\n'),
(414, '2021-08-23 13:11:05', 453, 32, '<strong> As per our site visit meeting and based on our work scope, the following considerations need to be addressed:</strong> <br>\r\n* Critical work area – Taxiway G <br>\r\n* Work always on Pull-back <br>\r\n* No escorts on-site -- Be aware of flying aircrafts overhead. <br>\r\n* Same rules that apply to the Calgary Airport will apply to the Springbank airport. <br>\r\n\r\n<strong> We need to identify:</strong> <br>\r\n* Identify working area <br>\r\n* Safe routes to a medical centre. <br>\r\n* Appointed personnel to assist in an emergency. <br>\r\n* Airside Haul Route <br>\r\n* Evacuation exit(s). <br>\r\n* Reduce aircraft impact by controlling air pollution. <br>\r\n* High noise decibels. <br>\r\n* Two electric boxes <br>\r\n* Monitor wells <br>\r\n* Safely operate heavy equipment. <br>\r\n\r\n\r\n<strong> Some of the Following hazards identified on site:</strong> <br>\r\nAircrafts ons site - High noise decibels – concrete silica particles present – workspace limitation. <br>\r\nThis JHA will be followed and updated weekly to consider any new job tasks/hazards that may arise. <br>'),
