(418, '2021-09-09 15:55:58', 455, 32, '<strong> As per our site visit meeting and based on our work scope, the following items need to be considered: </strong><br>\r\n<br>\r\n<strong> We need to identify: </strong><br>\r\n* Working area <br>\r\n* Safe routes to a medical centre <br>\r\n* Appointed personnel to assist in an emergency <br>\r\n* Evacuation exit(s) <br>\r\n* High noise decibels <br>\r\n* Catch basins on-site and within its proximity (Implement measures to prevent any material from entering the sewer system) <br>\r\n* Electricity and communications manholes on site <br>\r\n* Fire hydrants on site <br>\r\n* Street light poles on site <br>\r\n* Gas line North-West to the job site <br>\r\n* Heavy equipment operating on site <br>\r\n<br>\r\n<strong> Some of the Following hazards were identified on site: </strong> <br>\r\n* Concrete silica particles present <br>\r\n* Gas line North-West to the job site <br>\r\n* Electric manholes on site <br>\r\n* Sidewalk along Aero Drive NE <br>\r\n<br>\r\nThis JHA will be followed and updated weekly to consider any new job tasks/hazards that may arise.'),
