(424, '2021-09-29 12:42:53', 468, 32, '<strong> As per our site visit and based on our scope of work, the following items need to be considered: </strong><br>\r\n<br>\r\n<strong> We need to identify: </strong><br>\r\n* Working area<br>\r\n* Evacuation exit(s)<br>\r\n* Safe routes to a medical centre<br>\r\n* Appointed personnel to assist in an emergency.<br>\r\n<br>\r\n<strong> The Following hazards were identified on site: </strong><br>\r\n* Three (3) open excavation areas<br>\r\n* One electric box West to the work area<br>\r\n* One electric manhole East to the work area<br>\r\n* Three (3) young pine trees West to the work area<br>\r\n* Calgary United Cabs personnel on the parking lot SW to the work area<br>\r\n* Overhead power lines SW to the work area<br>\r\n<br>\r\nThis JHA will be followed and updated when new job tasks and/or hazards arise'),
