(431, '2021-10-03 16:48:32', 465, 32, '<strong>As per our site visit and based on our scope of work, the following items need to be considered:</strong><br>\r\n<br>\r\n<strong>We need to identify:</strong><br>\r\n* Working area<br>\r\n* Evacuation exit(s)<br>\r\n* Safe routes to a medical centre<br>\r\n* Appointed personnel to assist in an emergency<br>\r\n<br>\r\n<strong>The Following hazards were identified on site:</strong><br>\r\n* Working at heights<br>\r\n* Sharp Objects (Aluminum truss frames)<br>\r\n* Polished floors could become a hazard if the Manlift is not secured in place with the brakes on and if any liquid is spilled and not cleaned promptly<br>\r\n* YYC personnel on-site<br>\r\n* YYC Passengers/customers<br>\r\n<br>\r\nThis JHA will be followed and updated when new job tasks and/or hazards arise.'),
(432, '2021-10-14 08:16:35', 463, 32, ''),
(433, '2021-10-15 15:27:14', 472, 32, ''),
(434, '2021-10-15 17:30:10', 473, 32, '<strong>GLASS WALL REMOVAL AND RELOCATION</strong><br>\r\n<br>\r\n<strong>As per our site visit and based on our scope of work, the following items need to be considered:</strong><br>\r\n<br>\r\n<strong>We need to identify:</strong><br>\r\n* Working area<br>\r\n* Evacuation exit(s)<br>\r\n* Safe routes to a medical centre<br>\r\n* Appointed personnel to assist in an emergency<br>\r\n<br>\r\n<strong>The Following hazards were identified on site:</strong><br>\r\n* Working at heights<br>\r\n* YYC personnel on-site<br>\r\n* YYC Passengers<br>\r\n* Use of power and hand tools<br>\r\n* Potentially, sharp objects on the site<br>\r\n* Polished floors<br>\r\n<br>\r\n<strong>Forms to fill out daily</strong><br>\r\n- Equipment inspection report <br>\r\n- Daily fall protection form <br>\r\n- Field Level Hazard Assessment <br>\r\n<br>\r\nThis JHA will be followed and updated when new job tasks and/or hazards arise'),
(435, '2021-10-18 08:02:26', 469, 32, ''),
(436, '2021-10-18 14:29:55', 474, 3, ''),
(437, '2021-10-19 11:25:16', 475, 32, '<strong>YELLOW LOT - ELECTRICAL TRENCH (CUSTOM ELECTRIC YYC)</strong> <br>\r\n<br>\r\n<strong>Scope of Work:</strong> <br>\r\n<br>\r\n•	Saw cut and dispose off site of waste materials.<br>\r\n•	Hydro-excavation.<br>\r\n•	Supply and install trenching box to facilitate trench related labour work.<br>\r\n•	Backfilling with engineering fill, granular materials.<br>\r\n•	Supply and place HMAC City Mix B.<br>\r\n•	Supply and place concrete curb.<br>\r\n<br>\r\n<strong> As per our site visit and based on our work scope, the following items need to be considered: </strong> <br>\r\n<br>\r\n<strong> We need to identify: </strong> <br>\r\n* Designated work area <br>\r\n* Appointed personnel to assist in an emergency <br>\r\n* Evacuation exit(s) <br>\r\n* Safe routes to a medical centre <br>\r\n* The use of full Personal Protective Equipment (PPE) is mandatory at all times while at the jobsite.<br>\r\n<br>\r\n<strong> The following hazards are present on site: </strong> <br>\r\n* Outdoor electrical outlets<br>\r\n* Public, pedestrians, and drivers<br>\r\n* Heavy equipment operating on site <br>\r\n* High noise decibels <br>\r\n* Concrete silica particles present <br>\r\n<br>\r\n<strong>THE FOLLOWING LIST ILLUSTRATES HAZARDS PER ACTIVITY:</strong> <br>\r\n<br>\r\n<strong>Public, pedestrians and drivers:</strong><br>\r\n- To avoid any public or pedestrian injury, always assess the area(s) to evaluate the risk from high to low.<br>\r\n- Use signage at all times, as well as preventive walls if flying debris is eminent<br>\r\n<br>\r\n<strong> Mobilization and demobilization: </strong> <br>\r\n- Make sure all loads are properly secured. <br>\r\n- Inspect each load before accessing public roads. <br>\r\n- Exercise caution when loading and offloading equipment. <br>\r\n <br>\r\n<strong> Setting up signage: </strong> <br>\r\n- Consider the location of each sign to prevent pedestrians and traffic confusion. <br>\r\n- Consider the location of each sign to prevent pedestrians from getting hurt. <br>\r\n<br>\r\n<strong> Backing up: </strong> <br>\r\n- A spotter must be in place when backing up Equipment, Hydrovacs, and Trucks. <br>\r\n- Drivers must make eye contact with personnel on foot. <br>\r\n<br>\r\n<strong> Hydrovac: </strong> <br>\r\n- Use PPE at all times while working with or near the hydrovac. <br>\r\n- Inspect the hoses each day before and after use. <br>\r\n- Hydrovac operators must prevent damages to PVC pipes or any underground utility. <br>\r\n<br>\r\n<strong> Concrete and asphalt cutting: </strong> <br>\r\n- Use PPE at all times for protection from flying debris. A face shield/eyeglasses should be worn if nearby or performing this activity. <br>\r\n- Use dust-free power tools equipped with a vacuum and use water to keep the dust down. <br>\r\n- Inspect and test tools before use. <br>\r\n- Take regular breaks from cutting or switch with another worker to relieve arm fatigue. <br>\r\n<br>\r\n<strong> Excavating / Placing shoring: </strong> <br>\r\n- Operators make sure to follow trench excavating procedures - No one should access the excavation zone without a proper slope or the use of shorings in the trench. <br>\r\n- On-foot personnel must make eye contact with the operator at all times. <br>\r\n- When moving shoring structures, a secure line must be in place to control the load. <br>\r\n- An spotter must be present at all times. <br>\r\n- No mechanical excavation can take place less than 30 cm. - Use H beams to secure \"hanging\" or expose sections properly. <br>\r\n<strong> Loading off-site materials: </strong> <br>\r\n- Drivers must make eye contact with the loader operator. <br>\r\n- Loader operator must make eye contact with drivers and on-foot personnel. <br>\r\n- Make sure the ground is level before loading trucks. <br>\r\n- Drivers must tarp each load to prevent debris from flying out to public roads. <br>\r\n<br>\r\n<strong> Backfilling: </strong> <br>\r\n- Make sure no organics are present within clean backfill material. <br>\r\n- Each Lift must be 30 cm or one foot thick. <br>\r\n- No worker should access a trench without a proper trench slope or the use of shorings. <br>\r\n<br>\r\n<strong> Asphalt patching/paving: </strong> <br>\r\n- Make sure you use earplugs or earmuffs as well as proper respiratory masks <br>\r\n- Exercise caution when dealing with high-temperature materials. <br>\r\n- The use of high-temperature-resistant gloves is recommended.  <br>\r\n- Adequate hydration must be monitored by workers periodically. <br>\r\n<br>\r\n<strong> E R P </strong> <br>\r\n* The primary muster point will be located West to the work area.<br>\r\n* Head counter- <strong> Hugo Villamil </strong> <br>\r\n* Directions to the nearest hospital - <strong> Peter Lougheed Centre </strong> <br>\r\n* Emergency on-site station (EOS) - <strong> Eyewash, first aid, OHS Handbook </strong> <br>\r\n* Extinguishers – <strong> Found in ESO and each truck/equipment. </strong> <br>\r\n* Covid 19 – <strong> Follow protocols and YYC mandatory regulations - Face mask is mandatory while working at YYC </strong> <br>\r\n<br>\r\n <strong> Special items to monitor </strong> <br>\r\n* Weather: high wind, heavy rain, snowfall. <br>\r\n<br>\r\nThis JHA will be updated when new job tasks and/or hazards arise or if there is any change in our scope of work.\r\n'),
(438, '2021-10-19 15:33:38', 473, 32, ''),
(439, '2021-10-20 13:55:14', 474, 32, ''),
(440, '2021-10-25 09:29:26', 468, 32, ''),
(441, '2021-10-25 13:52:16', 477, 32, '<strong>CONCOURSE B SIDEWALK AND CONCOURSE A TRENCH</strong>\r\n<br>\r\n<strong>Scope of Work:</strong>\r\n• Removal of the cracked and heaved portion of the sidewalk as well as its extension on the proximal 6 panels.\r\n• Replacement of sidewalk\r\n• Repair and reinstall guardrail on the new sidewalk. If repair is not feasible, replace guardrail with steel sections.\r\n<br>\r\n<strong>As per our site visit meeting and based on our work scope, the following items need to be considered:</strong>\r\n<br>\r\n<strong>Items to keep in mind before entering Airside:</strong> <br>\r\n- Children or pets are NOT allowed on the airside. <br>\r\n- No knives, guns, littering or smoking are allowed airside. <br>\r\n- Hold a valid picture ID (driver license / passport) and your Restricted Area Identity Card (RAIC) pass <br>\r\n- Visitors must return their visitor pass before leaving Airside<br>\r\n- Beacons or four ways hazard light must be on when working airside. <br>\r\n- Personal Protective Equipment use is mandatory while on the job site.<br>\r\n<br>\r\n<strong>We need to identify:</strong><br>\r\n- Working area<br>\r\n- Safe routes to a medical centre<br>\r\n- Appointed personnel to assist in an emergency<br>\r\n- Evacuation exit(s)<br>\r\n<br>\r\n<strong>Some of the Following hazards were identified on site:</strong><br>\r\n- Concrete silica particles present<br>\r\n- YYC personnel on site<br>\r\n- Aircrafts in the area<br>\r\n- Building adjacent to work area<br>\r\n<br>\r\n<strong>THE FOLLOWING LIST ILLUSTRATES HAZARDS PER ACTIVITY: </strong> <br>\r\n<br>\r\n<strong>Public, pedestrians and drivers - YYC Staff:</strong><br>\r\n- To avoid any public or pedestrian injury, always assess the area(s) to evaluate the risk from high to low<br>\r\n- Use signage at all times, as well as preventive walls if flying debris is eminent<br>\r\n<br>\r\n<strong>Working close to an existing building:</strong> <br>\r\n- Avoid any damage to the adjacent building(s). If necessary use plywood to avoid any impact on the building siding<br>\r\n- Use a spotter when operating a machine close to a building to prevent any impact to the structure<br>\r\n<br>\r\n<strong> Mobilization and demobilization: </strong> <br>\r\n- Make sure all loads are properly secured. <br>\r\n- Inspect each load before accessing public roads. <br>\r\n- Exercise caution when loading and offloading equipment. <br>\r\n <br>\r\n<strong> Setting up signage: </strong> <br>\r\n- Consider the location of each sign to prevent pedestrians and traffic confusion. <br>\r\n- Consider the location of each sign to prevent pedestrians from getting hurt. <br>\r\n<br>\r\n<strong> Driving and Backing up: </strong> <br>\r\n- The use of cellphone or electronic devices is prohibited at all times while driving any motorized vehicle<br>\r\n- Drivers must make eye contact with personnel on foot.<br>\r\n- Be aware of changes in the weather. Do a proper Inspection and adjust your driving to the current weather conditions<br>\r\n- A spotter must be in place when backing up Equipment, Hydrovacs, and Trucks.<br>\r\n<br>\r\n<strong> Concrete and asphalt cutting: </strong> <br>\r\n- Use PPE at all times for protection from flying debris. A face shield/eyeglasses should be worn if nearby or performing this activity. <br>\r\n- Use dust-free power tools equipped with a vacuum and use water to keep the dust down. <br>\r\n- Inspect and test tools before use. <br>\r\n- Take regular breaks from cutting or switch with another worker to relieve arm fatigue. <br>\r\n<br>\r\n<strong> Excavating:</strong><br>\r\n- On-foot personnel must make eye contact with the operator at all times. <br>\r\n- An spotter must be present at all times. <br>\r\n<br>\r\n<strong> Loading off-site materials: </strong> <br>\r\n- Drivers must make eye contact with the loader operator. <br>\r\n- Loader operator must make eye contact with drivers and on-foot personnel. <br>\r\n- Make sure the ground is level before loading trucks. <br>\r\n- Drivers must tarp each load to prevent debris from flying out to public roads. <br>\r\n <br>\r\n<strong>Power and Hand Tool Use:</strong><br>\r\n- To protect yourself against flying debris, use protective eye-wear AND face shield. Always wear protective gloves and use guards where appropriate<br>\r\n- Minimize the time individuals use the equipment (e.g. job rotation). Restrict use of vibration inducing tools to recommended times<br>\r\n- Wear proper hearing protection to avoid hearing damage<br>\r\n- Do not use heat-generating equipment without Hot Work Permit, do not work near flammables, compressed gases, in explosive atmospheres or confined spaces without specialist advice, check with Clerk of Works before using flammable fuel or gas driven equipment<br>\r\n- Always wear proper PPE when using sharp objects. Make sure the sharp object has being relocated, removed, or controlled before moving on with a different task<br>\r\n<br>\r\n<strong> Backfilling: </strong> <br>\r\n- Make sure no organics are present within clean backfill material. <br>\r\n- Each Lift must be 30 cm or one foot thick. <br>\r\n- No worker should access a trench without a proper trench slope or the use of shorings. <br>\r\n<br>\r\n<strong>Packer:</strong><br>\r\n- Get to know the limits of the equipment and what is capable of doing on steep slopes or wet ground<br>\r\n- Always make eye contact with the co-workers around the unit, if a co-worker approaches the machine to communicate, make sure the hydraulic bottom or lever is on OFF position<br>\r\n<br>\r\n<strong> Concrete Placing: </strong> <br>\r\n- Make sure you use earplugs or earmuffs as well as proper respiratory masks <br>\r\n- Exercise caution when dealing with high-temperature materials. Use all necessary PPE to protect yourself <br>\r\n- The use of high-temperature-resistant gloves is recommended.  <br>\r\n- Adequate hydration must be monitored by workers periodically. <br>\r\n<br>\r\n<strong> E R P </strong> <br>\r\n- The muster point will be located NW to the prime area and NE to gate 32. A sign will be located by the mezzanine stairs below Concourse B<br>\r\n- Head counter- <strong> Wilson Franco </strong> <br>\r\n- Directions to the nearest hospital will be posted on the site\'s fence- <strong> Peter Lougheed Centre </strong> <br>\r\n- Emergency on-site station (EOS) - <strong> Eyewash, first aid, OHS Handbook </strong> <br>\r\n- Extinguishers – <strong> Found in ESO and each truck/equipment. </strong> <br>\r\n- Covid 19 – <strong> Follow protocols and YYC mandatory regulations</strong> <br>\r\n<br>\r\n <strong> Special items to monitor </strong> <br>\r\n- Weather: high wind, heavy rain, snowfall. <br>\r\n- Any mud on the road shall be identified and dealt with by the contractor. <br>\r\n<br>\r\nThis JHA will be updated when new job tasks and/or hazards arise or if there is any change in our scope of work.'),
