(453, '2021-12-09 11:12:45', 486, 32, 'POND M – FLOWMETER INSTALLATION (YYC)\r\n\r\nScope of Work:\r\n\r\n• Install flowmeters at Pond M\r\n\r\nAs per our site visit meeting and based on our work scope, the following hazards were identified on site:\r\n\r\n- Opening and guarding manholes\r\n- Working in Confined Spaces\r\n- Working airside\r\n- Working in cold temperatures, possible ice formation\r\n- Working with hand and power tools\r\n\r\nThis JHA will be updated when new job tasks and/or hazards arise or if there is any change in our scope of work.\r\n'),
